import React, { Component } from "react";
import PageNavbar from "./PageNavbar";
export default class Posters extends Component {
  constructor() {
    super();
    this.state = {
      Movies: [],
    };
  }

  componentDidMount() {
    fetch("http://localhost:8081/posters", { method: "GET" })
      .then((res) => res.json())
      .then();
  }

  render() {
    return (
      <div>
        <PageNavbar />
      </div>
    );
  }
}
